import React from 'react';
import { DataGrid } from '@material-ui/data-grid';

class MainTableComponent extends React.Component
{
    constructor(props) {
        super(props)
        this.state = {
            spreadSheetRows: props.spreadSheetRows,
            spreadSheetColumns: props.spreadSheetColumns,
        };
    }

    componentDidUpdate(prevProps)
    {
        if (prevProps !== this.props){
            this.setState({
                spreadSheetRows: this.props.spreadSheetRows,
                spreadSheetColumns: this.props.spreadSheetColumns
            })
        }
    }

    render()
    {
        return (
            <div style={{ height: 650, width: '100%' }}>
            <DataGrid
                rows={this.state.spreadSheetRows}
                columns={this.state.spreadSheetColumns}
                pageSize={10}
                rowsPerPageOptions={[10]}
            />
            </div>
        );
    }
}

export default MainTableComponent;
